lways felt the weight of other people\u2019s expectations on my shoulders. I\u2019ve carried their burdens for so long that I\u2019ve found I\u2019ve left nothing for myself.  Nobody ever reaches out to me. Nobody makes sure that I\u2019m okay. I have to be my own rock, as well as other people\u2019s.People take, and they take, and they take. They use me when they need me, they thank me for being a good friend...Sometimes I think about how sad my lot in life is. I think about the fact that I am strong for others means that no one ever feels the need to be strong for me. Sometimes it makes me cry.I\u2019m expected to be okay. I\u2019m expected to keep my sh*t together. If I ever opened up to people about how I felt, I doubt that they\u2019d even know what to say.Well, I\u2019m not.I\u2019m tired. I\u2019m worn out. I\u2019m fed up of being the \u2018strong\u2019 one. I\u2019m done with being used.I need to learn to be there for myself before I\u2019m there for anyone else. I need to put myself first before I use my precious strength for other people. I need to be strong for my own sake.I feel far more than I let on. The waves of life rock me every time they hit me, no matter how much I may seem to stand firm in front of them. \nBut I will be okay. I know I will. I have learn to do for myself what I\u2019ve always been able to do for other people. I have learn to carry my own burden. I\u2019ll become strong for myself. I could easily allow myself to dwell in my misery. I could torment myself with the knowledge that no one has picked up on how exhaust.. #kind #love #kindness #baby #mama #kinderen #happy #familie #bekind #kids #life #ouders #beautiful #kinder #kindnessmatters #smile #family #motivation #happiness #positivevibes #instagram #like #peace #humble #inspiration #cute #art #positivity #quotes #bhfyp"}}]},"shortcode":"B9xY-D_g1IK","edge_media_to_comment":{"count":0},"taken_at_timestamp":1584312736,"dimensions":{"height":938,"width":750},"display_url":"https://s
